syntax = "proto3";
option java_package = "emu.grasscutter.net.proto";
import "HomeMarkPointFurnitureData.proto";
import "Vector.proto";


message HomeMarkPointSceneData {
	uint32 module_id = 7;
	uint32 scene_id = 15;
	Vector safe_point_pos = 11;
	Vector teapot_spirit_pos = 12;
	repeated HomeMarkPointFurnitureData furniture_list = 9;
}